import LoginForm from "../components/LoginForm";
import styles from "../styles/from.css";

const LoginPage = () => {
  return (
     <div className={style.authWrapper}>
      <div className={styles.containerauth}>
      <h1>Login</h1>
      <LoginForm />
      </div>
      </div>
  );
};

export default LoginPage;
